import React from 'react';
import './App.css';
import MainContainer from './containers/MainContainer'
import NavBar from './components/NavBar'

class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <MainContainer />
      </React.Fragment>
    );
  }
}

export default App;
